import styled from 'styled-components';

export const Wrapper = styled.div`
  position: fixed;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  box-shadow: 0px 2px 5px rgba(0, 0, 0, 0.3);
  width: 350px;
  height: 220px;
`;

export const Title = styled.h1`
  font-size: 18px;
  color: #0058e4;
`;
